import Main from "./Main";
// import Nav from "./Nav";
// import Edit from "./Edit";
import Sidebar from "./Sidebar";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/notes" element={<Main />}></Route>
        <Route path="/edits" element={<Sidebar />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
